import React, { Component } from 'react';

class Commercant extends Component {
    render() {
        return (
            <div>
                <form>
                    <div class = "mb-3">
                        <label for="exampleInpulEmail1" class="form-label">Adresse mail :</label>
                        <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"></input>
                        <div id="emailHelp" class="form-text">Renseigner votre adresse mail</div>
                    </div>
                    
                    <div class = "mb-3">
                        <label for="exampleInpulEmail1" class="form-label">Adresse mail :</label>
                        <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"></input>
                        <div id="emailHelp" class="form-text">Renseigner votre adresse mail</div>
                    </div>
                </form>
            </div>
        );
    }
}

export default Commercant;
